import { isNull } from "@tsparticles/engine";
export class PixelsOptions {
    constructor() {
        this.offset = 4;
    }
    load(data) {
        if (isNull(data)) {
            return;
        }
        if (data.offset !== undefined) {
            this.offset = data.offset;
        }
    }
}
